import { Link } from "react-router-dom";

const Navbar = () => (
  <nav style={{ marginBottom: 24 }}>
    <Link to="/" style={{ marginRight: 16 }}>Anasayfa</Link>
    <Link to="/products" style={{ marginRight: 16 }}>Ürünler</Link>
    <Link to="/add-product" style={{ marginRight: 16 }}>Ürün Ekle</Link>
    <Link to="/categories">Kategoriler</Link>
  </nav>
);

export default Navbar;
